import React, {Component} from 'react';
import Detail from "./Detail/Detail";
import {Route} from "react-router-dom";
import MyNavLink from "../../MyNavLink";

class News extends Component {
    state={
        news_array:[
            {id:"01",title:"这是标题1"},
            {id:"02",title:"这是标题2"},
            {id:"03",title:"这是标题3"},
            {id:"04",title:"这是标题4"}
        ]
    }
    render() {
        return (
            <ul>
                {
                    this.state.news_array.map((NewsObj)=>{
                        return <li className="News_content" key={NewsObj.id}>
                            <MyNavLink to="/home/news/detail">id:{NewsObj.id},{NewsObj.title}</MyNavLink>
                            {/*注册路由*/}

                        </li>
                    })
                }

                <Route path="/home/news/detail" component={Detail}/>
            </ul>
        );
    }
}

export default News;
